description:
Summer Vengeance 3rd meets 8th in a close battle to move on

Aug 16, 2013 - Performers: Cheyenne Jewel  and  Yasmine Loven 


WMV only. MP4 + Pics later. 


Cheyenne Jewel

&quot;The Wrangler &quot; 
Height:  5'5&quot; 
Weight:  127lbs 
Season W/L:  (3 - 0)  
Lifetime W/L:  (6 - 1)  


Yasmine Loven

&quot;The Lightning Bolt&quot; 
Height:  5'2&quot; 
Weight:  155lbs 
Season W/L:  (2 - 2)  
Lifetime W/L:  (4 - 5)  


Cheyenne Jewel was ranked pretty high for SV for a girl who didn't even wrestle for us last year. She's been impressive all season and she has a decent shot at making to the finals for Summer Vengeance if she can get past Yasmine Loven.

Fans of U/S don't seem to fully understand how outstanding Yasmine Loven is. She's only had a handful of matches and she's ranked 8th in Summer Vengeance. When Yasmine Loven is having a good day, she's unstoppable. She's a 19 year old Prodigy who's still learning how to tap into her greatness. Today she taps into that greatness and gets a chance to tap Cheyennes ass.

Cheyennes thinks she has this one in the bag and as Yasmine bulldozes her on the mat she realizes she's in for a rude awakening. Cheyenne is in shock and awe of Yasmine's skill.

